import React from "react";
import { NavLink } from "react";
function Home() {
  return (
    <div>
      <br />
      <div className="container" style={{ width: "300px" }}>
        <div
          className="row rounded-pill "
          style={{ backgroundColor: "grey", justifyContent: "center" }}
        >
          <NavLink></NavLink>
        </div>
      </div>
    </div>
  );
}

export default Home;
